import styled from "styled-components";
export const ContentBlock = styled.div`
  width: 100%;
  height: 85vh;
  display: flex;
  position: relative;
`;

export const ContentPage = styled.section`
  width: 90%;
  height: 85vh;
  background-color:#eee;
`;

export const ContentItem = styled.article`
  padding: 3%;
  height: 88%;
  margin-top: 1.5%;
  background-color:fuchsia;
  border-radius: 35px;
  overflow: auto;
`;
